import React from 'react';
import PropTypes from 'prop-types';

const Contacts = () => {
  console.log(this.props);
  return (
    <div>
      <span>{this.props.name}</span>
      <span>{this.props.phone}</span>
    </div>
  );
};

Contacts.propTypes = {};

export default Contacts;
